import React from 'react';
import {observer, inject} from 'mobx-react';
import TestStore from '../store/testStore';

interface Props{
    testStore?:TestStore;
}

@inject('testStore')
@observer
class TestContainer extends React.Component<Props>{
  
    render(){
        return(
            <div>
                test
            </div>
        );
    }
}

export default TestContainer;
